'''Michael Fred Phelps II''' (born June 30, 1985) is a retired<ref>{{cite news|last=Shaikin|first=Bill|title=Michael Phelps answers all on first day of retirement|url=http://articles.latimes.com/2012/aug/05/sports/la-sp-on-michael-phelps-20120805|accessdate=2012-08-08|newspaper=The Los Angeles Times|date=August 5, 2012}}</ref> American [[swimming (sport)|swimmer]] and the [[List of multiple Olympic medalists|most decorated Olympian of all time]], with a total of 22 medals. Phelps also holds the all-time records for [[List of multiple Olympic gold medalists#List of most Olympic gold medals over career|Olympic gold medals]] (18, double the second highest record holders), [[List of multiple Olympic gold medalists#List of most career gold medals in individual events|Olympic gold medals in individual events]] (11), and [[List of multiple Olympic medalists#List of most career medals in individual events|Olympic medals in individual events for a male]] (13). In winning eight gold medals at the [[2008 Summer Olympics|2008 Beijing Games]], Phelps took the record for the most [[List of multiple Olympic gold medalists at a single Games#List of most individual gold medals won at a single Olympic Games|first-place finishes at any single Olympic Games]]. Five of those victories were in individual events, tying the [[List of multiple Olympic gold medalists at a single Games#List of most individual gold medals won at a single Olympic Games|single Games record]]. In the [[2012 Summer Olympics]] in London, Phelps won four golds and two silver medals, making him the [[List of multiple Olympic gold medalists at a single Games|most successful]] athlete of the Games for the third Olympics in a row.<ref>[http://www.swimnews.com/News/view/9743 Franklin Pips Phelps For Top Honour]</ref>

Phelps is the [[long course]] world recordholder in the [[World record progression 100 metres butterfly|100-meter butterfly]], [[World record progression 200 metres butterfly|200-meter butterfly]] and [[World record progression 400 metres individual medley|400-meter individual medley]] as well as the former long course world recordholder in the [[World record progression 200 metres freestyle|200-meter freestyle]] and [[World record progression 200 metres individual medley|200-meter individual medley]].  He has won a total of 71 medals in major international long-course competition, 57 gold, 11 silver, and three bronze spanning the Olympics, the [[FINA World Aquatics Championships|World]], and the [[Pan Pacific Swimming Championships|Pan Pacific]] Championships.  Phelps's international titles and record-breaking performances have earned him the [[Swimming World Swimmers of the Year|World Swimmer of the Year Award]] seven times and [[Swimming World Swimmers of the Year#American Swimmer of the Year|American Swimmer of the Year Award]] nine times.  His unprecedented Olympic success in 2008 earned Phelps ''[[Sports Illustrated]]'' magazine's [[Sportsman of the Year]] award.

After the 2008 Summer Olympics, Phelps started the Michael Phelps Foundation, which focuses on growing the sport of swimming and promoting healthier lifestyles.  He expects to do further work with his foundation after the 2012 Olympics, which he has said will be his last.

==Early life==

Phelps was born and raised in the Rodgers Forge neighborhood of [[Towson, Maryland]], located just north of [[Baltimore]].<ref name="voyage">{{cite web |title=Phelps' voyage|url=http://www.baltimoresun.com/sports/olympics/bal-te.sp.phelps03aug03,0,5792765.story|work=The Baltimore Sun|date=August 3, 2008|archiveurl =http://www.webcitation.org/5sWfHxTXl|archivedate =September 5, 2010|accessdate =2010-09-05}}</ref> Michael is the youngest of three children. His mother, Deborah Sue "Debbie" (née Davisson), is a middle school principal.<ref name="Phelps, ''Beneath the Surface'', p. 15."/> His father, Michael Fred Phelps, is a retired Maryland state trooper who played [[American football|football]] in high school and college and tried out for the [[Washington Redskins]] in the 1970s.<ref name="Phelps, ''Beneath the Surface'', p. 15.">Phelps, ''Beneath the Surface'', p. 15.</ref><ref name=sun2001>{{cite news |title=Life in the Fast Lane |url=http://www.baltimoresun.com/sports/olympics/bal-phelps0609,0,6686072,full.story |work=[[The Baltimore Sun]] |date=January 14, 2001 |accessdate=2012-07-31 |author=Hiaasen, Rob}}</ref> Phelps's parents divorced in 1994, and his father remarried in 2000.<ref name=sun2001/> His ancestry includes [[English people|English]], [[Irish people|Irish]], [[Scottish people|Scottish]], [[Welsh people|Welsh]], and [[German people|German]].<ref>{{cite web|url=http://freepages.genealogy.rootsweb.ancestry.com/~battle/olympics08/phelps.htm |title=michael phelps |publisher=Freepages.genealogy.rootsweb.ancestry.com |accessdate=2012-08-01}}</ref> Phelps graduated from [[Towson High School]] in 2003.<ref name="Towson High">{{cite news|last=Klingaman|first=Mike|title=Towson High proud to have its own star in Phelps|url=http://articles.baltimoresun.com/2007-03-31/sports/0703310085_1_michael-phelps-towson-high-kimmie-meissner|accessdate=2012-07-28|newspaper=Baltimore Sun|date=May 31, 2007}}</ref>

Phelps began swimming at the age of seven, partly because of the influence of his sisters and partly to provide him with an outlet for his energy.<ref>Phelps, ''Beneath the Surface'', p. 16.</ref> When Phelps was in the sixth grade, he was diagnosed with [[attention-deficit hyperactivity disorder]] (ADHD).<ref>Phelps, ''Beneath the Surface'', p. 24.</ref><ref>Schaller, p. 4.</ref> By the age of 10, he held a national record for his age group, and Phelps began to train at the [[North Baltimore Aquatic Club]] under coach [[Bob Bowman (coach)|Bob Bowman]]. More age group records followed, and Phelps's rapid improvement culminated in his qualifying for the [[Swimming at the 2000 Summer Olympics|2000 Summer Olympics]] at the age of 15 and becoming the youngest male to make a U.S. Olympic swim team in 68 years.<ref>Phelps, ''Beneath the Surface'', p. 85.</ref> While he did not win a medal, he did make the finals and finished fifth in the 200-meter butterfly.<ref>Phelps, ''Beneath the Surface'', p. 78.</ref>

At the World Championship Trials for the [[2001 World Aquatics Championships]], on March 30, Phelps broke the world record in the 200-meter butterfly to become, at 15 years and 9 months, the youngest man ever to set a swimming world record, breaking the record previously held by [[Ian Thorpe]] when he lowered the 400-meter freestyle world record at 16 years, 10 months.<ref>Phelps, ''Beneath the Surface'', p. 88.</ref> At the World Championships in [[Fukuoka]], Phelps broke his own world record in the 200-meter butterfly en route to becoming a world champion for the first time.<ref>Phelps, ''Beneath the Surface'', p. 92.</ref>

