{{MedalBottom}}

At Nationals, the selection meet for the [[2002 Pan Pacific Swimming Championships]], in [[Fort Lauderdale, Florida|Fort Lauderdale]], Phelps set an American record in the 200-meter individual medley and was just off the world record in the 200-meter butterfly.<ref>Phelps, ''Beneath the Surface'', p. 109.</ref> In the 400-meter individual medley, Phelps bettered the world record held by [[Tom Dolan]] with a time of 4:11.09, just ahead of [[Erik Vendt]], who finished second with a time of 4:11.27, also below the old world record.  In the 200-meter freestyle, Phelps was barely beaten by [[Klete Keller]] and in the 100&nbsp;m butterfly, Phelps beat [[Ian Crocker]].<ref name="Phelps, ''Beneath the Surface'', p. 110">Phelps, ''Beneath the Surface'', p. 110</ref>

At the 2002 Pan Pacific Swimming Championships in [[Yokohama]], Phelps won three gold medals and two silvers.  In his first event, the 400-meter individual medley, Phelps won gold ahead of [[Erik Vendt]] with a time of 4:12.48.  In the 200-meter butterfly, Phelps lost to [[Tom Malchow]], finishing behind him 1:55.41 to 1:55.21.  Phelps said he lost because he did not take butterfly training seriously after he broke the world record.  In the 200-meter individual medley, Phelps won with a time of 1:59.70.  In the 4×200-meter freestyle relay, Phelps, along with [[Nate Dusing]], Klete Keller, and [[Chad Carvin]], won the silver medal with a time 7:11.81 finishing behind Australia.  The U.S. 4×100-meter medley relay team consisted of [[Aaron Peirsol]], [[Brendan Hansen]], Phelps, and Ian Crocker.  In the final for the medley relay, Phelps swam a 51.1 split, at the time the fastest split in history.  The final time of 3:33.48 was a world record.<ref name="Phelps, ''Beneath the Surface'', p. 111">Phelps, ''Beneath the Surface'', p. 111</ref>

