At Nationals, Phelps won the 200-meter freestyle, 200-meter backstroke, and the 100-meter butterfly.<ref name="Phelps, ''Beneath the Surface'', p. 122.">Phelps, ''Beneath the Surface'', p. 122.</ref> He became the first American swimmer to win three different races in three different strokes at a national championship.<ref name="Phelps, ''Beneath the Surface'', p. 122."/> At the 2003 Duel in the Pool, a meet that pits swimming stars from Australia and the United States, Phelps broke the world record in the 400-meter individual medley with a time of 4:10.73 and almost broke the world record in the 100-meter butterfly, just missing the record by 0.03 seconds.<ref>Phelps, ''Beneath the Surface'', p. 123.</ref> At a meet in [[Santa Clara County, California|Santa Clara]], Phelps broke the world record in the 200-meter individual medley with a time of 1:57.94.<ref>Phelps, ''Beneath the Surface'', p. 134.</ref> Phelps said he broke the 200-meter individual medley world record after [[Don Talbot]] said Phelps was unproven, using his words as motivation.<ref>Phelps, ''Beneath the Surface'', p. 133.</ref>

At the [[2003 World Aquatics Championships]], Phelps won four gold medals, two silver medals, and broke five world records.<ref>{{cite news|url=http://www.cbc.ca/sports/story/2003/07/27/phelps030727.html|accessdate=2009-09-06|title=Phelps breaks fifth record at aquatic worlds|publisher=Canadian Broadcasting Corporation|date=July 28, 2003}}</ref> Phelps broke his first world record on July 22 in the semi-finals for the 200-meter butterfly.  Phelps swam a 1:53.93 to break his own world record of 1:54.58 set in 2001 and became the first man to swim under 1:54.00.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2003/barcelona2003/F74_ResSummary_216_Semifinal_Men_200_Fly.pdf|title=2003 World Championships – Men's 200 m butterfly results (semifinal)|publisher=Omega Timing| accessdate=2010-06-12}}</ref> In the final of the 200-meter butterfly, on July 23, Phelps easily won the gold medal, but did not come close to his world record with a time of 1:54.35.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2003/barcelona2003/F73_ResByHeat_116_Final_Men_200_Fly.pdf|title=2003 World Championships – Men's 200 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> Less than an hour later, Phelps swam the lead-off leg for the 4×200-meter freestyle relay.  Phelps put up a solid time of 1:46.60 (an American record) but the Americans could not match the depth of the Australians and ultimately finished second 7:10.26 to 7:08.58.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2003/barcelona2003/F73_ResByHeat_121_Final_Men_4x200_Free.pdf|title=2003 World Championships – Men's 4×200 m freestyle relay results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> In the 200-meter individual medley, Phelps showed complete dominance.  On July 24, in the semifinals of the 200-meter individual medley, Phelps broke his own world record with a time of 1:57.52.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2003/barcelona2003/F74_ResSummary_225_Semifinal_Men_200_Medley.pdf|title=2003 World Championships – Men's 200 m individual medley results (semifinal)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> On July 25, in the final of the 200-meter individual medley, Phelps smashed his own record with a time of 1:56.04 to win the gold medal and finished almost 3 seconds ahead of [[Ian Thorpe]].<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2003/barcelona2003/F73_ResByHeat_125_Final_Men_200_Medley.pdf|title=2003 World Championships – Men's 200 m individual medley results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> About an hour before the final of the 200-meter individual medley, Phelps swam in the semifinals of the 100-meter butterfly.  Phelps again showed dominance, finishing in the top seed with a world record time of 51.47.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2003/barcelona2003/F74_ResSummary_229_Semifinal_Men_100_Fly.pdf|title=2003 World Championships – Men's 100 m butterfly results (semifinal)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> However, in the final of the 100-meter butterfly, on July 26, [[Ian Crocker]] erased Phelps's world record with a time of 50.98, to become the first man under 51 seconds.  Phelps swam a 51.10 (also under his former world record), but had to settle for silver.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2003/barcelona2003/F73_ResByHeat_129_Final_Men_100_Fly.pdf|title=2003 World Championships – Men's 100 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> In the final of the 400-meter individual medley, on July 27, Phelps broke his own world record with a time of 4:09.09 to easily claim the gold medal.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2003/barcelona2003/F73_ResByHeat_138_Final_Men_400_Medley.pdf|title=2003 World Championships – Men's 400 m individual medley results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> About half an hour later, Phelps earned his final gold medal when the United States team won the 4×100-meter medley relay.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2003/barcelona2003/F73_ResByHeat_140_Final_Men_4x100_Medley.pdf|title=2003 World Championships – Men's 4×100 m medley relay results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> Phelps did not swim in the finals, but still earned a medal because he swam in the heats.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2003/barcelona2003/F74_ResSummary_40_Prelim_Men_4x100_Medley.pdf|title=2003 World Championships – Men's 4×100 m medley relay results (heats)|publisher=Omega Timing|accessdate=2010-06-12}}</ref>

