===Trials===
At the 2004 U.S. Olympic Team Trials, Phelps competed in six events, including the 200- and 400-medley individual medley, the 100- and 200-meter butterfly, the 200-meter freestyle, and the 200-meter backstroke.<ref>Phelps, ''Beneath the Surface'', p. 179.</ref> In his first event, the 400-meter individual medley, Phelps easily won with a world record time of 4:08.41.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2004/longbeach_2_2004/F73_ResByHeat_101_Final_Men_400_Medley.pdf|title=2004 U.S. Olympic Team Trials – Men's 400 m individual medley results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> Two days later, in the 200-meter freestyle, Phelps won with a time of 1:46.27, finishing sixth-tenths of a second ahead of [[Klete Keller]].<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2004/longbeach_2_2004/F73_ResByHeat_107_Final_Men_200_Free.pdf|title=2004 U.S. Olympic Team Trials – Men's 200 m freestyle results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> Phelps, however, was not pleased with the result and wanted to be in the 1:45s and was uncertain if he would swim the event in [[Athens]].<ref>Phelps, ''Beneath the Surface'', p. 181.</ref> The following day, Phelps won in the 200-meter butterfly with a time of 1:54.31, three seconds ahead of second place finisher [[Tom Malchow]].<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2004/longbeach_2_2004/F73_ResByHeat_112_Final_Men_200_Fly.pdf|title=2004 U.S. Olympic Team Trials – Men's 200 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> After two days off, Phelps was back in the pool and finished second to [[Aaron Peirsol]] in the 200-meter backstroke.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2004/longbeach_2_2004/F73_ResByHeat_118_Final_Men_200_Back.pdf|title=2004 U.S. Olympic Team Trials – Men's 200 m backstroke results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> Less than half an hour later, Phelps won the 200&nbsp;m individual medley title ahead of [[Ryan Lochte]] by 2.70 seconds.<ref>Phelps, ''Beneath the Surface'', p. 184.</ref><ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2004/longbeach_2_2004/F73_ResByHeat_120_Final_Men_200_Medley.pdf|title=2004 U.S. Olympic Team Trials – Men's 200 m individual medley results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> The following day, Phelps finished second to [[Ian Crocker]] in the 100&nbsp;m butterfly.  Crocker won in a time of 50.76, a world record and 0.39 seconds ahead of Phelps.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2004/longbeach_2_2004/F73_ResByHeat_123_Final_Men_100_Fly.pdf|title=2004 U.S. Olympic Team Trials – Men's 100 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> When the Trials were over, Phelps became the first person to qualify in six individual events for a U.S. Olympic team.<ref name="Phelps, ''Beneath the Surface'', p. 186.">Phelps, ''Beneath the Surface'', p. 186.</ref> However, Phelps dropped the 200-meter backstroke to focus on the 200-meter freestyle because he wanted to race [[Ian Thorpe]].<ref name="Phelps, ''Beneath the Surface'', p. 186."/> Even though Phelps didn't compete in the 100-meter freestyle at the Trials, he was still selected for the 4×100-meter freestyle relay.  [[Gary Hall, Jr.]] thought this was unfair and said Phelps did not deserve a spot on the relay.  Phelps argued his program was too crowded to compete in 100-meter freestyle and was at least among the top four swimmers because he had beaten the top-seeded [[Jason Lezak]] the last time he had swum against him.<ref>Phelps, ''Beneath the Surface'', p. 191.</ref>

===Olympics===
In his first event, the 400-meter individual medley, Phelps won with a world record time of 4:08.26 to win his first Olympic gold medal.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2004/athensog2004/C73A1_Res1Heat_101_Final_1_Men_400_Medley.pdf|title=Games of the XXVIIIth Olympiad – Men's 400 m individual medley results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref><ref>Schaller, p. 35.</ref> The following day, in the 4×100-meter freestyle relay, Phelps, along with [[Ian Crocker]], [[Neil Walker (swimmer)|Neil Walker]], and [[Jason Lezak]], finished in third place with a time of 3:14.62.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2004/athensog2004/C73B1_Res1HeatRelay_112_Final_1_Men_4x100_Free.pdf|title=Games of the XXVIIIth Olympiad – Men's 4×100 m freestyle relay results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref><ref>Schaller, p. 36.</ref> Crocker's lead-off time of 50.05 was the worst among the field and was blamed on sickness.<ref>Phelps, ''Beneath the Surface'', p. 202.</ref><ref>Schaller, p. 37.</ref> In the event many were calling ''The Race of the Century'', held the following day, Phelps finished in third place behind [[Ian Thorpe]] and [[Pieter van den Hoogenband]] in the 200-meter freestyle.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2004/athensog2004/C73A1_Res1Heat_108_Final_1_Men_200_Free.pdf|title=Games of the XXVIIIth Olympiad – Men's 200 m freestyle results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref><ref>Schaller, p. 38.</ref> Although this race ended the chance to match Spitz's record, Phelps had savored the challenge even though it was not his strongest event, saying "How can I be disappointed? I swam in a field with the two fastest freestylers of all time".<ref>Phelps, ''Beneath the Surface'', p. 204.</ref> In his fourth event, the 200-meter butterfly, held the following day, Phelps finished first with a time of 1:54.04, breaking [[Tom Malchow]]'s Olympic record.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2004/athensog2004/C73A1_Res1Heat_114_Final_1_Men_200_Fly.pdf|title=Games of the XXVIIIth Olympiad – Men's 200 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref><ref>Schaller, p. 39.</ref> About an hour later, in the 4×200-meter freestyle relay, Phelps, along with [[Ryan Lochte]], [[Peter Vanderkaay]], and [[Klete Keller]], finished in first place with a time of 7:07.33.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2004/athensog2004/C73B1_Res1HeatRelay_119_Final_1_Men_4x200_Free.pdf|title=Games of the XXVIIIth Olympiad – Men's 4×200 m freestyle relay results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> Two days later, in the 200-meter individual medley, Phelps finished first with a time of 1:57.14, an Olympic record.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2004/athensog2004/C73A1_Res1Heat_123_Final_1_Men_200_Medley.pdf|title=Games of the XXVIIIth Olympiad – Men's 200 m individual medley results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> In the 100-meter butterfly final, held the following day, Phelps defeated American teammate [[Ian Crocker]] (who held the world record in the event at the time) by just 0.04 seconds with a time of 51.25.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2004/athensog2004/C73A1_Res1Heat_127_Final_1_Men_100_Fly.pdf|title=Games of the XXVIIIth Olympiad – Men's 100 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref><ref name="Schaller, p. 40">Schaller, p. 40.</ref> Traditionally, the American who places highest in an individual event will be automatically given the corresponding leg in the 4×100&nbsp;m medley relay final. This gave Phelps an automatic entry into the medley relay, but he deferred and Crocker swam instead.<ref name="Schaller, p. 40"/><ref name="Phelps, ''Beneath the Surface'', p. 218.">Phelps, ''Beneath the Surface'', p. 218.</ref> Phelps's gesture gave Crocker a chance to make amends as well getting his final shot at a gold medal.<ref name="Phelps, ''Beneath the Surface'', p. 218."/> The American medley team went on to win the event in world-record time, and, since Phelps had raced in a preliminary heat of the medley relay, he was also awarded a gold medal along with the team members who competed in the final.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2004/athensog2004/C74B_ResSummaryRelay_32_Prelim_Men_4x100_Medley.pdf|title=Games of the XXVIIIth Olympiad – Men's 4×100 m medley relay results (heats)|publisher=Omega Timing|accessdate=2010-06-12}}</ref><ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2004/athensog2004/C73B1_Res1HeatRelay_132_Final_1_Men_4x100_Medley.pdf|title=Games of the XXVIIIth Olympiad – Men's 4×100 m medley relay results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> In winning six gold and two bronze medals, Phelps, still a teenager, had the [[List of multiple Olympic gold medalists at a single Games|second-best performance]] ever at a single Olympics, behind [[Mark Spitz]]'s seven gold medals in [[1972 Summer Olympics|Munich]] in 1972. Also, he became the second male swimmer ever to win more than two individual titles at a single Games with four, tying Spitz's four from 1972.

