At the 2005 World Championship Trials, Phelps decided to drop his specialty events, the 400-meter individual medley and the 200-meter butterfly, and experiment with the 400-meter freestyle and the 100-meter freestyle.<ref>Phelps, ''Beneath the Surface'', p. 243.</ref> Phelps went on to win the 400-meter freestyle, the 200-meter freestyle, the 100-meter butterfly, the 100-meter freestyle, and the 200-meter individual medley at the Trials.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2005/indianapolis2005/F73_ResByHeat_102_Finals_Men_400_Free.pdf|title=2005 World Championship Trials – Men's 400 m freestyle results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref><ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2005/indianapolis2005/F73_ResByHeat_108_Finals_Men_200_Free.pdf|title=2005 World Championship Trials – Men's 200 m freestyle results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref><ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2005/indianapolis2005/F73_ResByHeat_113_Finals_Men_100_Fly.pdf|title=2005 World Championship Trials – Men's 100 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref><ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2005/indianapolis2005/F73_ResByHeat_117_Finals_Men_100_Free.pdf|title=2005 World Championship Trials – Men's 100 m freestyle results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref><ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2005/indianapolis2005/F73_ResByHeat_119_Finals_Men_200_Medley.pdf|title=2005 World Championship Trials – Men's 200 m individual medley results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref>

At the [[2005 World Aquatics Championships]], Phelps won a total of six medals, 5 golds and one silver.<ref>Schaller, p. 59.</ref>  In the 400-meter freestyle, Phelps did not make it past the preliminary heats and finished 18th overall with a time of 3:50.53.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2005/montreal2005/F74_ResSummary_2_Heats_Men_400_Free.pdf|title=2005 World Championships – Men's 400 m freestyle results (heats)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> Later that day, in the 4×100-meter freestyle relay, Phelps won his first gold in the Championships.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2005/montreal2005/F73_ResByHeat_108_Finals_Men_4x100_Free.pdf|title=2005 World Championships – Men's 4×100 m freestyle relay results (heats)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> Two days later, on July 26, Phelps won his second gold in the 200-meter freestyle with a new American record time of 1:45.20, finishing ahead of [[Grant Hackett]].<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2005/montreal2005/F73_ResByHeat_110_Finals_Men_200_Free.pdf|title=2005 World Championships – Men's 200 m freestyle results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> Two days later, on July 28, Phelps finished seventh in the 100-meter freestyle final.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2005/montreal2005/F73_ResByHeat_119_Finals_Men_100_Free.pdf|title=2005 World Championships – Men's 100 m freestyle results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> Later that day, Phelps won his third gold in the 200-meter individual medley.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2005/montreal2005/F73_ResByHeat_121_Finals_Men_200_Medley.pdf|title=2005 World Championships – Men's 200 m individual medley results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> On July 29, Phelps, along with [[Ryan Lochte]], [[Peter Vanderkaay]] and [[Klete Keller]], won the gold in the 4×200-meter freestyle relay with a time of 7:06.58.  This was the fourth gold medal for Phelps.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2005/montreal2005/F73_ResByHeat_132_Finals_Men_4x200_Free.pdf|title=2005 World Championships – Men's 4×200 m freestyle relay results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> On July 30, Phelps swam in his last individual event, the 100-meter butterfly.  In the final, Phelps could not match the speed of [[Ian Crocker]] and had to settle for silver, finishing 51.65 to 50.40.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2005/montreal2005/F73_ResByHeat_130_Finals_Men_100_Fly.pdf|title=2005 World Championships – Men's 100 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> On July 31, Phelps earned his final gold medal when the United States team won the 4×100-meter medley relay.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2005/montreal2005/F73_ResByHeat_140_Finals_Men_4x100_Medley.pdf|title=2005 World Championships – Men's 4×100 m medley relay results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> Phelps did not swim in the finals but still earned a medal because he swam in the heats.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2005/montreal2005/F74_ResSummary_40_Heats_Men_4x100_Medley.pdf|title=2005 World Championships – Men's 4×100 m medley relay results (heats)|publisher=Omega Timing|accessdate=2010-06-12}}</ref>

