At the 2006 National Championships, Phelps won a total of three events.<ref>Phelps, ''Beneath the Surface'', p. 261.</ref> In his first event, the 200-meter butterfly, Phelps won with a time of 1:54.32.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2006/irvine1_2006/F73_ResByHeat_112_Finals_Men_200_Fly.pdf|title=2006 ConocoPhillips National Championships – Men's 200 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> In his second event, the 100-meter butterfly, Phelps just edged out [[Ian Crocker]] 51.51 to 51.73.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2006/irvine1_2006/F73_ResByHeat_115_Finals_Men_100_Fly.pdf|title=2006 ConocoPhillips National Championships – Men's 100 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> In his third event, the 200-meter individual medley, Phelps won with a time of 1:56.50, just ahead of [[Ryan Lochte]]'s time of 1:56.78.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2006/irvine1_2006/F73_ResByHeat_122_Finals_Men_200_Medley.pdf|title=2006 ConocoPhillips National Championships – Men's 200 m individual medley results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref>

At the [[2006 Pan Pacific Swimming Championships]] in [[Victoria, British Columbia|Victoria]], Phelps won five gold medals and one silver.<ref>Phelps, ''Beneath the Surface'', p. 264.</ref> In his first event, the 200-meter butterfly, Phelps won in a world record time of 1:53.80, his first world record in two years.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2006/victoria_2006/F73_ResByHeat_108_Finals_Men_200_Fly.pdf|title=2006 Pan Pacific Swimming Championships – Men's 200 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> In his second event, the 400-meter individual medley, Phelps easily won with a time of 4:10.47, 3.38 seconds ahead of second place finisher [[Robert Margalis]].<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2006/victoria_2006/F73_ResByHeat_114_Finals_Men_400_Medley.pdf|title=2006 Pan Pacific Swimming Championships – Men's 400 m individual medley results (final)|accessdate=2010-06-12}}</ref> In his third event, the 4×200-meter freestyle relay, Phelps, along with [[Ryan Lochte]], [[Peter Vanderkaay]], and [[Klete Keller]], won the gold medal with a time of 7:05.28.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2006/victoria_2006/F74_ResSummary_16_Heats_Men_4x200_Free.pdf|title=2006 Pan Pacific Swimming Championships – Men's 4×200 m freestyle relay results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> In his fourth event, the 200-meter backstroke, Phelps won the silver medal, finishing behind [[Aaron Peirsol]] 1:56.81 to 1:54.44.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2006/victoria_2006/F73_ResByHeat_122_Finals_Men_200_Back.pdf|title=2006 Pan Pacific Swimming Championships – Men's 200 m backstroke results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> In his fifth event, the 4×100-meter freestyle relay, Phelps, along with [[Neil Walker (swimmer)|Neil Walker]], [[Cullen Jones]], and [[Jason Lezak]], won the gold medal with a world-record time 3:12.46.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2006/victoria_2006/F74_ResSummary_24_Heats_Men_4x100_Free.pdf|title=2006 Pan Pacific Swimming Championships – Men's 4×100 m freestyle relay results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref> In his sixth event, the 200-meter individual medley, Phelps won with a world record time of 1:55.84, breaking his record of 1:55.94 set in 2003.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2006/victoria_2006/F73_ResByHeat_126_Finals_Men_200_Medley.pdf|title=2006 Pan Pacific Swimming Championships – Men's 200 m individual medley results (final)|publisher=Omega Timing|accessdate=2010-06-12}}</ref>

