{{MedalBottom}}

At the [[2007 World Aquatics Championships]], Phelps won seven gold medals, tying the record, and broke five world records.<ref>Schaller, p. 60.</ref> Phelps first gold medal came in the 4×100-meter freestyle. Phelps swam the lead-off leg in 48.42 seconds and [[Neil Walker (swimmer)|Neil Walker]], [[Cullen Jones]] and [[Jason Lezak]] each expanded the lead to win in a Championship record of 3:12.72, just missing the world record of 3:12.46 set the previous year.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2007/melbourne2007/F73_ResByHeat_108_Finals_Men_4x100_Free.pdf|title=12th FINA World Championships – Men's 4×100 m freestyle relay results (final)|publisher=Omega Timing|accessdate=2010-06-13}}</ref> His lead-off time was faster than the winning time in the individual 100-meter freestyle final later in the meet. Phelps set his first world record in the Championships in the 200-meter freestyle, his second race. Phelps won the gold ahead of [[Pieter van den Hoogenband]] and broke [[Ian Thorpe]]'s six-year-old world record with a time of 1:43.86.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2007/melbourne2007/F73_ResByHeat_110_Finals_Men_200_Free.pdf|title=12th FINA World Championships – Men's 200 m freestyle results (final)|publisher=Omega Timing|accessdate=2010-06-13}}</ref> For his third race, the 200-meter butterfly, Phelps won the gold and bettered his own world record of 1:53.71 with a time of 1:52.09.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2007/melbourne2007/F73_ResByHeat_115_Finals_Men_200_Fly.pdf|title=12th FINA World Championships – Men's 200 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-06-13}}</ref> For his fourth race, the 200-meter individual medley, Phelps set his third world record with a time of 1:54.98, bettering his own world-record time of 1:55.84<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2007/melbourne2007/F73_ResByHeat_121_Finals_Men_200_Medley.pdf|title=12th FINA World Championships – Men's 200 m individual medley results (final)|publisher=Omega Timing|accessdate=2010-06-13}}</ref> For his fifth race, the 4×200-meter freestyle relay, Phelps swam the lead-off leg in 1:45.36 as the American team of [[Ryan Lochte]], [[Klete Keller]], and [[Peter Vanderkaay]] went on to win the gold medal and beat the previous world record set by Australia in 2001 with a time 7:03.24.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2007/melbourne2007/F73_ResByHeat_132_Finals_Men_4x200_Free.pdf|title=12th FINA World Championships – Men's 4×200 m freestyle relay results (final)|publisher=Omega Timing|accessdate=2010-06-13}}</ref> For his sixth race, the 100-meter butterfly, Phelps edged out [[Ian Crocker]] 50.77 to 50.82 to win his sixth gold medal.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2007/melbourne2007/F73_ResByHeat_130_Finals_Men_100_Fly.pdf|title=12th FINA World Championships – Men's 100 m butterfly results (final)|accessdate=2010-06-13}}</ref> For his seventh event, the 400-meter individual medley, Phelps won the gold medal in a world-record time of 4:06.22, more than 3.5 seconds ahead of [[Ryan Lochte]].<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2007/melbourne2007/F73_ResByHeat_138_Finals_Men_400_Medley.pdf|title=12th FINA World Championships – Men's 400 m individual medley results (final)|publisher=Omega Timing|accessdate=2010-06-13}}</ref> By winning seven gold medals, Phelps broke the record of six set by [[Ian Thorpe]] at the [[2001 World Aquatics Championships|2001 World Championships]]. The 4×100-meter medley relay team would have competed in the final, but received a disqualification for a false start during a changeover in the heats, ending Phelps's chance of eight gold medals.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2007/melbourne2007/F74_ResSummary_40_Heats_Men_4x100_Medley.pdf|title=12th FINA World Championships – 4×100 m medley relay results (heats)|publisher=Omega Timing|accessdate=2010-06-13}}</ref>

Even though Phelps competed in the backstroke in international competition only once (at the [[2006 Pan Pacific Swimming Championships|2006 Pan Pacific Championships]]), he was among the best backstroke swimmers in the world. This is illustrated by his personal best times set in 2007, four months after the World Championships. At the [[United States Swimming National Championships|US Nationals]] in Indianapolis on August 1, 2007, Phelps swam a 1:54.65 in the 200-meter backstroke, which was the third fastest of all time in the event, 0.33 of a second off the world record of 1:54.32 held by [[Ryan Lochte]].<ref>[http://swimnews.com/News/view/5474 Phelps Fells Lochte Over 200m Back]</ref> Two days later Phelps swam a time of 53.01 sec in the 100-meter backstroke, 0.03 of a second short of the world record of 52.98 held by [[Aaron Peirsol]] and the second-fastest performance of all time.<ref>[http://edition.cnn.com/2007/SPORT/08/04/swim.phelps.reut/index.html?eref=edition_sport&utm_source=feedburner&utm_medium=feed&utm_campaign=Feed%3A+rss%2Fedition_sport+(RSS%3A+Sport) Phelps grabs two titles in an hour]</ref>
In 2007 Phelps swam into the all-time top 3 performances in seven individual events, four of these being world records.

