===Trials===
At the 2008 U.S. Olympic Team Trials, Phelps competed in six individual events.  In his first event, the 400-meter individual medley, Phelps broke his own world record of 4:06.22 with a time of 4:05.25.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2008/Omaha_b_2008/C73A1_Res1Heat_101_Finals_1_Men_400_Medley.pdf|title=2008 U.S. Olympic Team Trials – 400 m individual medley results (final)|publisher=Omega Timing|accessdate=2010-06-13}}</ref> In his second event, the 200-meter freestyle, Phelps won with a time of 1:44.10, ahead of [[Peter Vanderkaay]]'s time 1:45.85.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2008/Omaha_b_2008/C73A1_Res1Heat_107_Finals_1_Men_200_Free.pdf|title=2008 U.S. Olympic Team Trials – 200 m freestyle results (final)|publisher=Omega Timing|accessdate=2010-06-13}}</ref> In his third event, the 100-meter freestyle, Phelps placed second in his heat with a time of 47.92, ensuring him a spot on the relay.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2008/Omaha_b_2008/C74A_ResSummary_14_Heats_Men_100_Free.pdf|title=2008 U.S. Olympic Team Trials – 100 m freestyle results (heats)|publisher=Omega Timing|accessdate=2010-06-13}}</ref> In his fourth event, the 200-meter butterfly, Phelps won with a time of 1:52.20.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2008/Omaha_b_2008/C73A1_Res1Heat_112_Finals_1_Men_200_Fly.pdf|title=2008 U.S. Olympic Team Trials – 200 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-06-13}}</ref> In his fifth event, the 200-meter individual medley, Phelps broke his own world record of 1:54.98 with a time of 1:54.80.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2008/Omaha_b_2008/C73A1_Res1Heat_112_Finals_1_Men_200_Fly.pdf|title=2008 U.S. Olympic Team Trials – 200 m individual medley results (final)|publisher=Omega Timing|accessdate=2010-06-13}}</ref> In his sixth and final event, the 100-meter butterfly, Phelps won with a time of 50.89.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2008/Omaha_b_2008/C73A1_Res1Heat_123_Finals_1_Men_100_Fly.pdf|title=2008 U.S. Olympic Team Trials – 100 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-06-13}}</ref> When asked about his chances of winning eight gold medals in Beijing, Phelps said, "I am going to prepare for that meet just like I do every other meet ... There is only so much I can do in a month and then I am going to prepare myself the best that I can."<ref>Schaller, p. 83.</ref>

===Olympics===
Phelps set an [[Olympic record]] in the preliminary heats of the 400-meter individual medley.<ref>Phelps, ''No Limits'', p. 45.</ref><ref>Schaller, p. 117.</ref> He followed that up in the final by winning the gold medal, as well as breaking his previous world record by nearly two seconds.<ref>Phelps, ''No Limits'', p. 52.</ref><ref>Schaller, p. 129.</ref>

Phelps swam the first leg of the 4×100-meter freestyle relay in a time of 47.51 seconds (an American record for the 100-meter freestyle), and won his second gold medal of the 2008 Olympics, as well as setting his second world record of the Olympics (3:08.24).<ref>Schaller, p. 145.</ref> Teammate [[Jason Lezak]], after beginning the anchor leg more than half a body length behind [[Alain Bernard]], managed to finish ahead of the second-place French team by eight hundredths of a second. The top five teams in the final finished ahead of the world record of 3:12.23 set the previous day by the American B team in a preliminary heat.<ref>Phelps, ''No Limits'', p. 97.</ref>

For his third race, Phelps broke his previous world record in the 200-meter freestyle by nearly a second and won his third gold medal. He also set his third world record at the Olympics, 1:42.96, winning by nearly two seconds over silver medalist [[Park Tae-Hwan]].<ref>Phelps, ''No Limits'', p. 129.</ref> In this race, Phelps became only the fifth Olympic athlete in modern history to win nine gold medals, joining [[Mark Spitz]], [[Larisa Latynina]], [[Paavo Nurmi]], and [[Carl Lewis]].<ref>Phelps, ''No Limits'', p. 130.</ref>
[[File:Michael Phelps Ryan Lochte Laszlo Cseh medals 2008 Olympics.jpg|thumb|Phelps holds his gold medal on the podium on August 10, 2008. Pictured with [[Ryan Lochte]] and [[László Cseh]]]]
The next day, Phelps participated in two finals. In his first event, the [[Swimming at the 2008 Summer Olympics – Men's 200 metre butterfly|200&nbsp;m butterfly]], Phelps made it four gold medals and world records in four events by swimming the final in 1:52.03, defeating silver medalist [[László Cseh]] by almost seven-tenths of a second despite his goggles' having filled up with water and being unable to "see anything for the last 100 meters.<ref>Phelps, ''No Limits'', p. 151.</ref> This fourth gold medal was his tenth, and made him the all-time leader for most Olympic gold medals won by an individual in the modern Olympic era.<ref>Phelps, ''No Limits'', p. 152.</ref> Moreover, Phelps became the first swimmer, male or female, to win three Olympic butterfly titles, after his two titles in the Athens 2004 Olympics. He also became the first swimmer to successfully defend an Olympic butterfly title.

Less than one hour after his gold medal victory in the 200-meter butterfly, Phelps swam the lead-off leg of the 4×200-meter freestyle relay. With Lochte, [[Ricky Berens]], and [[Peter Vanderkaay]], he won his fifth gold and set his fifth world record as the American team finished first with a time of 6:58.56. The Americans were the first team to break the seven-minute mark in the relay, and broke the previous record, set in [[Melbourne, Australia]], by more than four and a half seconds.<ref>Phelps, ''No Limits'', p. 176.</ref>

After taking a day off from finals (Phelps did swim in qualifying heats), Phelps won his sixth gold of the Beijing Games on August 15 by winning the 200-meter individual medley with a world record time of 1:54.23, finishing ahead of Cseh by over two seconds.<ref>Phelps, ''No Limits'', p. 184.</ref>

====Seventh gold medal and controversy====

[[File:Phelps4x100.jpg|thumb|left|Phelps starting the 4x100m relay at the Beijing, August 11, 2008]]
Before the final of the 100-meter butterfly, Serbian-American swimmer [[Milorad Čavić]] caused a minor stir when he said it would be "good" if Phelps lost. "It'd be good for him if he loses.  It would be nice if historians talk about Michael Phelps winning seven gold medals and losing the eighth to 'some guy.' I'd like to be that guy", Čavić said.</small><ref>Schaller, p. 174.</ref> Phelps responded, "When people say things like that, it fires me up more than anything."<ref>Schaller, p. 183.</ref> On August 16, Phelps won his seventh gold medal of the Games in the men's 100-meter butterfly, setting an Olympic record for the event with a time of 50.58 seconds and edging out his nearest competitor Čavić, by one one-hundredth (0.01) of a second.<ref>Phelps, ''No Limits'', p. 206.</ref>

Unlike all six of his previous events in the 2008 Games, Phelps did not set a new world record, leaving intact [[Ian Crocker]]'s world-record time of 50.40 seconds, set in 2005.

Phelps's 0.01-second finish ahead of Čavić prompted the Serbian delegation to file a protest. Subsequent analysis of the video by the [[International Swimming Federation|FINA]] panel, which required analyzing frames shot 1/10,000th of a second apart, was used to officially confirm Phelps's victory,<ref>Phelps, ''No Limits'', p. 207.</ref> but the images were not immediately released to the press. The initial refusal by official timekeeper Omega to release underwater photos of the finish also raised questions due to Phelps's sponsorship relationship with Omega.<ref>{{cite news|title=By Withholding Photos, Olympic Timekeeper Draws Attention to Relationship With Phelps|url=http://www.nytimes.com/2008/08/21/sports/olympics/21longman.html?em|work=The New York Times|date=August 20, 2008|accessdate=2010-06-13 | first=Jeré | last=Longman}}</ref> Čavić later wrote in his blog, "People, this is the greatest moment of my life. If you ask me, it should be accepted and we should move on. I've accepted defeat, and there's nothing wrong with losing to the greatest swimmer there has ever been."<ref>{{cite news|title=Cavic Finds a Personal Triumph in the Narrowest of Defeats|url=http://www.nytimes.com/2008/08/17/sports/olympics/17cavic.html|work=The New York Times|date=August 16, 2008|accessdate=2010-06-13 | first=Christopher | last=Clarey}}</ref> However, in August 2009, Omega officials stated that while Čavić "for sure" touched the wall first, "Phelps did it more forcefully," thus registering the time first.<ref>{{cite news|title=Omega admit Čavić Olympic injustice|url=http://www.b92.net/eng/news/society-article.php?yyyy=2009&mm=08&dd=07&nav_id=61012|publisher=B92|date=August 7, 2009|accessdate=2010-06-13}}</ref>

