Phelps's seventh gold medal of the Games tied [[Mark Spitz]]'s [[List of multiple Olympic gold medalists at a single Games|record]] for gold medals won in a single Olympic Games, set in the 1972 Olympics. It was also his fifth individual gold medal in Beijing, tying the [[List of multiple Olympic gold medalists at a single Games#List of most individual gold medals won at a single Olympic Games|record]] for individual gold medals at a single Games originally set by [[Eric Heiden]] in the 1980 Winter Olympics and equaled by [[Vitaly Scherbo]] at the 1992 Summer Games. Said Phelps upon setting his seventh-straight Olympic record of the Games in as many events, "Dream as big as you can dream, and anything is possible ... I am sort of in a dream world. Sometimes I have to pinch myself to make sure it is real."<ref>{{cite news|title=Phenomenal Phelps wins 7th gold by 0.01 seconds to tie Spitz|url=http://sports.espn.go.com/oly/summer08/swimming/news/story?id=3537831|accessdate=2012-08-01|newspaper=[[ESPN]]|date=August 16, 2008}}</ref>
[[File:Michael Phelps wins 8th gold medal.jpg|thumb|Michael Phelps celebrates with his teammates after winning his 8th gold medal.]]

====All-time record====
On August 17, Phelps won his eighth gold medal in the 4×100-meter medley relay, breaking [[Mark Spitz]]'s record of seven gold medals won in a single Olympic Games, which had stood since 1972.<ref name="Phelps, No Limits, p. 218">Phelps, ''No Limits'', p. 218.</ref> Phelps, along with teammates [[Brendan Hansen]], [[Aaron Peirsol]], and [[Jason Lezak]], set a new world record in the event with a time of 3 minutes and 29.34 seconds, 0.7 seconds ahead of second-place Australia and 1.34 seconds faster than the previous record set by the United States at the 2004 Olympic Games in [[Athens]]. When Phelps dived in to swim the 100-meter butterfly leg, the third leg of the 400-meter medley, the United States had been trailing Australia and Japan. Phelps completed his split in 50.1 seconds, the fastest butterfly split ever for the event, giving teammate Jason Lezak a more than half-second lead for the final leg, which he held onto to clinch the event in world record time.<ref>{{cite news|title = Phelps claims Olympic-record eighth gold medal with relay win|url =http://sportsillustrated.cnn.com/2008/olympics/2008/08/16/bc.oly.swm.phelps.medley.relay.ap/|work=Sports Illustrated|date = August 17, 2008|archiveurl = http://www.webcitation.org/5sG5JFJkf|archivedate =August 25, 2010|accessdate =2010-08-25}}</ref> Said Phelps, upon completing the event that awarded him his eighth gold medal and eighth Olympic record in as many events, "Records are always made to be broken no matter what they are ... Anybody can do anything that they set their mind to."<ref>{{cite news|title = Phelps wins historic eighth gold medal|url =http://edition.cnn.com/2008/SPORT/08/17/phelps.history.eight.golds/|publisher=CNN|date = August 17, 2008|archiveurl = http://www.webcitation.org/5sG5Q2gsk|archivedate =August 25, 2010|accessdate =2010-08-25}}</ref>

