At the 2009 National Championships, Phelps drastically shortened his program, swimming in only three individual events.  In his first event, the 200-meter freestyle, Phelps won with a time of 1:44.23.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2009/Indy2009/C73A1_Res1Heat_109_Finals_1_Men_200_Free.pdf|title=2009 National Championships – 200 m freestyle results (final)|publisher=Omega Timing|accessdate=2010-06-13}}</ref> In his second event, the 200-meter butterfly, Phelps easily won with a time of 1:52.76, 0.88 seconds ahead of the second place finisher.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2009/Indy2009/C73A1_Res1Heat_112_Finals_1_Men_200_Fly.pdf|title=2009 National Championships – 200 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-06-13}}</ref> In his third event, the 100-meter butterfly, Phelps won with a world-record time of 50.22.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2009/Indy2009/C73A1_Res1Heat_115_Finals_1_Men_100_Fly.pdf|title=2009 National Championships – 100 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-06-13}}</ref>
[[File:Michael Phelps before the start of the 200m butterfly semi-final - 2009 FINA World Championships.jpg|thumb|left|Phelps (center) before the start of the 200&nbsp;m butterfly semifinal during 2009 FINA World Championships.]]
At the [[2009 World Aquatics Championships]], Phelps won a total of 6 medals, 5 golds and 1 silver.  In his first event, the 4×100-meter freestyle relay, Phelps swam the lead-off leg in 47.78, well off his 47.51 performance in Beijing, but the American team was able to edge out Russia and France for the gold.<ref>{{cite news|title=World Records Fall in Swimming, and It's Only Day 1 |url=http://www.nytimes.com/2009/07/27/sports/27swim.html?hpw|work=The New York Times|author=Karen Crouse|date=July 27, 2009|accessdate=2009-08-05}}</ref> For his second race, the 200-meter freestyle, Phelps lost his first race in four years to Germany's [[Paul Biedermann]].  Phelps touched second in 1:43.22, but Biedermann smashed Phelps's record of 1:42.96 set in Beijing a year ago with a time of 1:42.00.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2009/Roma2009/C73A1_Res1Heat_110_Finals_1_Men_200_Free.pdf|title=2009 World Championships – 200 m freestyle results (final)|publisher=Omega Timing|accessdate=2010-06-19}}</ref> Phelps took the silver graciously, but coach [[Bob Bowman (coach)|Bob Bowman]] threatened to withdraw Phelps from international competition because Bowman claimed Biedermann had an unfair advantage because he was wearing a full [[polyurethane]] [[swimsuit]], specifically an [[Arena X-Glide]].  Bowman said, "It took me five years to get Michael from 1:46 to 1:42 and this guy has done it in 11 months. That's an amazing training performance. I'd like to know how to do that."<ref>{{cite news|title = Coach threatens to pull Phelps|url =http://sports.espn.go.com/oly/swimming/news/story?id=4360589|newspaper=ESPN|agency=Associated Press|date = July 28, 2009|archiveurl = http://www.webcitation.org/5sV8rNIaM|archivedate =September 4, 2010|accessdate =2010-09-04}}</ref> Phelps rebounded from this loss and for his third race, the 200-meter butterfly, Phelps won the gold and broke his own world record of 1:52.03 with a time of 1:51.51.<ref>{{cite news|title = Phelps bounces back from loss with record in 200-meter butterfly|url=http://sportsillustrated.cnn.com/2009/writers/brian_cazeneuve/07/29/phelps/|work=Sports Illustrated|date = July 29, 2009|archiveurl = http://www.webcitation.org/5sG5hd9Od|archivedate =August 25, 2010|accessdate =2010-08-25}}</ref> For his fourth race, the 4×200-meter freestyle relay, Phelps swam the lead-off leg in 1:44.49 as the team went on to win the gold medal and break the world record set the previous year.<ref>{{cite news|title=U.S. seals men's 4x200 relay title in record time
|url=http://theusdaily.com/articles/viewarticle.jsp?id=811304&type=home|work=The US Daily|author=Matt Daily and Braden Reddall|date=July 31, 2009|accessdate=2009-08-05}}</ref> After his loss in the 200-meter freestyle, many thought Phelps was vulnerable coming into the final for the 100-meter butterfly.<ref>{{cite news|title = Phelps refrains from adding to the fire|url =http://tvnz.co.nz/othersports-news/phelps-refrains-adding-fire-2881392/|agency=Television New Zealand|publisher=(Reuters)|date = July 31, 2009|archiveurl = http://www.webcitation.org/5sV9OasMh|archivedate =September 4, 2010|accessdate =2010-09-04}}</ref> His closest competitor, [[Milorad Čavić]], who wore an Arena X-Glide (the same suit Biedermann beat Phelps with), thought people were making excuses for Phelps because he was wearing an [[LZR Racer]].  Čavić even offered to buy Phelps a new suit.<ref>{{cite news|title=Cavic: I'll buy Phelps new suit|url=http://sports.espn.go.com/oly/swimming/news/story?id=4368336|work=ESPN|date=July 31, 2009|accessdate=2010-06-22}}</ref> For his fifth race, the 100-meter butterfly, Phelps won the gold and became the first man to complete it in under 50 seconds, beating Čavić 49.82 to 49.95.<ref>{{cite news|title=Phelps goes under 50 seconds in 100m butterfly
|url=http://www.irishtimes.com/newspaper/sport/2009/0803/1224251928081.html|work=The Irish Times  |author=John Kenny|date=August 3, 2009|accessdate=2009-08-05}}</ref> The victory prompted a fierce celebration from Phelps, who sat on the lane rope and pumped his chest and swimsuit.<ref>{{cite news|title=Phelps savours triumph over rival Cavic|url=http://news.smh.com.au/breaking-news-sport/phelps-savours-triumph-over-rival-cavic-20090802-e5eb.html|work=The Sydney Morning Herald|author=Rebecca Bryan |date=August 2, 2009|accessdate=2010-06-22}}</ref> For his final event, the 4×100-meter medley relay, Phelps won his fifth gold medal.  Phelps, along with teammates [[Aaron Peirsol]], [[Eric Shanteau]], and [[David Walters (swimmer)|David Walters]], set a new world record in the event with a time of 3 minutes and 27.28 seconds.<ref>{{cite news|title=Phelps Leaves Rome With Another Gold
|url=http://www.nytimes.com/2009/08/03/sports/03swim.html|work=The New York Times|author=Karen Crouse|date=August 2, 2009|accessdate=2009-08-05}}</ref>

