At the [[2010 USA Swimming Championships|2010 National Championships]], Phelps competed in five individual events.  In the 200-meter freestyle, Phelps won ahead of [[Ryan Lochte]] in a time of 1:45.61.<ref>{{cite web|url=http://omegatiming.com/swimming/racearchives/2010/IrvineUS/C73A1_Res1Heat_109_Finals_1_Men_200_Free.pdf|title=2010 ConocoPhillips National Championships – 200 m freestyle results (final)|publisher=Omega Timing|accessdate=2010-08-09}}</ref> About an hour later, Phelps returned to the pool to win the 200-meter butterfly.<ref>{{cite web|url=http://omegatiming.com/swimming/racearchives/2010/IrvineUS/C73A1_Res1Heat_112_Finals_1_Men_200_Fly.pdf|title=2010 ConocoPhillips National Championships – 200 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-08-09}}</ref> But Phelps was not happy with his performance and called it the "worst" 200-meter butterfly of his life.  In the 100-meter butterfly, Phelps won his 50th national title in 50.65.<ref>{{cite web|url=http://omegatiming.com/swimming/racearchives/2010/IrvineUS/C73A1_Res1Heat_115_Finals_1_Men_100_Fly.pdf|title=2010 ConocoPhillips National Championships – 100 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-08-09}}</ref> After the race, Phelps said he was "fairly pleased" with the result.<ref>{{cite news|title = No surprises -Phelps takes gold|url =http://www.sfgate.com/cgi-bin/article.cgi?f=/c/a/2010/08/05/SPMT1EPK99.DTL|newspaper=San Francisco Chronicle|agency=Associated Press|date = August 6, 2010|archiveurl = http://www.webcitation.org/5sVA0avnx|archivedate =September 4, 2010|accessdate =2010-09-04}}</ref><ref>{{cite news|title =Michael Phelps 'fairly pleased' after making history at US nationals|url =http://www.guardian.co.uk/sport/2010/aug/06/michael-phelps-us-nationals-100m-butterfly|work=The Guardian|date = August 6, 2008|archiveurl = http://www.webcitation.org/5sVAbeby0|archivedate =September 4, 2010|accessdate =2010-09-04| location=London}}</ref> In the 200-meter individual medley, Phelps finished second to Lochte 1:55.94 to 1:54.84.<ref>{{cite web|url=http://omegatiming.com/swimming/racearchives/2010/IrvineUS/C73A1_Res1Heat_122_Finals_1_Men_200_Medley.pdf|title=2010 ConocoPhillips National Championships – 200 m individual medley results (final)|publisher=Omega Timing|accessdate=2010-08-09}}</ref> It was the first time Lochte had beat Phelps in a major national meet.<ref>{{cite news|title=Ryan Lochte upsets Michael Phelps at national swimming championships|url=http://articles.latimes.com/2010/aug/06/sports/la-sp-national-swimming-20100807|work=Los Angeles Times|date=August 6, 2010|accessdate=2010-08-09 | first=Lisa | last=Dillman}}</ref> In the 200-meter backstroke, Phelps finished in 4th place in 1:56.98.<ref>{{cite web|url=http://omegatiming.com/swimming/racearchives/2010/IrvineUS/C73A1_Res1Heat_127_Finals_1_Men_200_Back.pdf|title=2010 ConocoPhillips National Championships – 200 m backstroke results (final)|publisher=Omega Timing|accessdate=2010-08-09}}</ref>

On the first day of competition at the [[2010 Pan Pacific Swimming Championships]], Phelps opted out swimming in the final of the 200-meter freestyle to focus on the 200-meter butterfly.  In the 200-meter butterfly, Phelps led from start to finish, coming in first with a time of 1:54.11.  Although it was much slower than his 1:51.51 time from the previous year, Phelps had not lost a 200-meter butterfly final since 2002.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2010/IrvinePPchampionships/C73A1_Res1Heat_108_Finals_1_Men_200_Fly.pdf|title=2010 Pan Pacific Swimming Championships – 200 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-08-18}}</ref><ref>{{cite news|title = Phelps extends dominance in 200 fly at Pan Pacs|url =http://www.google.com/hostednews/ap/article/ALeqM5gRdGMzTqPfw-5pdKxhGzXd7YkW_gD9HMAF1G0|agency=Associated Press|date = August 18, 2010|archiveurl = http://www.webcitation.org/5s5gsNxKs| archivedate = August 18, 2010| accessdate =2010-08-18}}</ref> On day two of the competition, Phelps swam in the heats of the 400-meter individual medley and contributed in the 4×200-meter freestyle relay.  In the heats of the 400-meter individual medley, Phelps failed to make the A final, with Lochte and [[Tyler Clary]] taking the top two American positions.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2010/IrvinePPchampionships/C74A_ResSummary_16_Heats_Men_400_Medley.pdf|title=2010 Pan Pacific Swimming Championships – 400 m individual medley results (heats)|publisher=Omega Timing|accessdate=2010-08-19}}</ref> Phelps did not swim in the B final of the 400-meter individual medley.  In the 4×200-meter freestyle relay, Phelps, with [[Peter Vanderkaay]], [[Ricky Berens]], and Lochte, finished first ahead of Japan and Australia.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2010/IrvinePPchampionships/C74B_ResSummaryRelay_20_Heats_Men_4x200_Free.pdf|title=2010 Pan Pacific Swimming Championships – 4×200&nbsp;m freestyle relay results (final)|publisher=Omega Timing|accessdate=2010-08-19}}</ref> On day three of the competition, Phelps competed in the 100-meter butterfly and contributed in the 4×100-meter freestyle relay.  In the 100-meter butterfly, Phelps finished first in a time of 50.86, a championship record.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2010/IrvinePPchampionships/C73A1_Res1Heat_124_Finals_1_Men_100_Fly.pdf|title=2010 Pan Pacific Swimming Championships – 100 m butterfly results (final)|publisher=Omega Timing|accessdate=2010-08-20}}</ref> In the 4×100-meter freestyle relay, Phelps, with Lochte, [[Jason Lezak]], and [[Nathan Adrian]], finished first ahead of Australia and South Africa.  As the lead-off leg in the 4×100-meter freestyle relay, Phelps set the [[List of Pan Pacific Championships records in swimming|championship record]] in the 100-meter freestyle with a time of 48.13.<ref>{{cite web|url=http://www.omegatiming.com/swimming/racearchives/2010/IrvinePPchampionships/C74B_ResSummaryRelay_30_Heats_Men_4x100_Free.pdf|title=2010 Pan Pacific Swimming Championships – 4×100&nbsp;m freestyle relay results (final)|publisher=Omega Timing|accessdate=2010-08-20}}</ref> In his final event, Phelps swam in the 4×100-meter medley relay with [[Aaron Peirsol]], [[Mark Gangloff]], and Adrian and finished first ahead of Japan and Australia.<ref>{{cite web|url=http://omegatiming.com/swimming/racearchives/2010/IrvinePPchampionships/C74B_ResSummaryRelay_140_Finals_Men_4x100_Medley.pdf|title=2010 Pan Pacific Swimming Championships – 4×100&nbsp;m medley relay results (final)|publisher=Omega Timing|accessdate=2010-08-21}}</ref>

