In his first event at the 2011 World Aquatics Championships in Shanghai, Phelps won bronze in the 4×100-meter freestyle relay with [[Garrett Weber-Gale]], [[Jason Lezak]], and [[Nathan Adrian]].<ref>{{cite news|title=FINA World Championships, Swimming: Australia Stuns France, U.S. For Men's 400 Free Relay Triumph; Two New Textile Bests|url=http://www.swimmingworldmagazine.com/lane9/news/27647.asp?q=FINA-World-Championships,-Swimming:--Australia-Stuns-France,-U.S.-For-Men's-400-Free-Relay-Triumph;-Two-New-Textile-Bests|work=Swimming World Magazine|date=July 24, 2011|accessdate=2011-07-27}}</ref>  This was Phelps's first bronze in a [[FINA World Aquatics Championships|World Aquatics Championships]].  Phelps swam the lead-off leg in 48.08, the second-best lead-off in the field behind [[James Magnussen]]'s 47.49.  In his second event, the 200-meter freestyle, Phelps won silver for the second consecutive time at a World Aquatics Championships.  This time he finished second to [[Ryan Lochte]] in the event with a time of 1:44.79, compared to Lochte's time of 1:44.44.<ref>{{cite news|title=FINA World Championships, Swimming: Ryan Lochte Bests Michael Phelps For 200 Free Gold|url=http://www.swimmingworldmagazine.com/lane9/news/27675.asp?q=FINA-World-Championships,-Swimming:-Ryan-Lochte-Bests-Michael-Phelps-For-200-Free-Gold|work=Swimming World Magazine|date=July 26, 2011|accessdate=2011-07-27}}</ref> In his third final, the 200-meter butterfly, he won his first gold medal with a time of 1:53.34 to become the first swimmer to win five gold medals in one discipline at the World Aquatics Championships.<ref>{{cite news|title=FINA World Championships, Swimming: Michael Phelps Closes Out Takeshi Matsuda for Gold Medal|url=http://www.swimmingworldmagazine.com/lane9/news/27694.asp?q=FINA-World-Championships,-Swimming:-Michael-Phelps-Closes-Out-Takeshi-Matsuda-for-Gold-Medal|work=Swimming World Magazine|date=July 27, 2011|accessdate=2011-07-27}}</ref> In his fourth event, the 200-meter individual medley, Phelps again finished second to Lochte in a personal best of 1:54.16, which was 0.16 behind Lochte who swam a new world record.<ref>{{cite news|title=FINA World Championships, Swimming: Ryan Lochte Sets First Post Techsuit-Era World Record|url=http://www.swimmingworldmagazine.com/lane9/news/27712.asp?=FINA-World-Championships,-Swimming:-Ryan-Lochte-Sets-First-Post-Techsuit-Era-World-Record|work=Swimming World Magazine|date=July 28, 2011|accessdate=2011-07-28}}</ref> It was Phelps's 30th medal in the World Aquatics Championships.  Shortly after completing the semifinals of the 100-meter butterfly, Phelps competed in the 4×200-meter freestyle relay with [[Peter Vanderkaay]], [[Ricky Berens]], and [[Ryan Lochte]]. Phelps's team won the gold medal in a time of 7:02.67.  Phelps swam the lead-off leg in 1:45.53, the third-best leg in the field.<ref>{{cite news|title=FINA World Championships, Swimming: Ryan Lochte's Monster Anchor Leg Secures United States Victory in 800 Free Relay|url=http://www.swimmingworldmagazine.com/lane9/news/27740.asp?q=FINA-World-Championships,-Swimming:-Ryan-Lochte's-Monster-Anchor-Leg-Secures-United-States-Victory-in-800-Free-Relay|work=Swimming World Magazine|date=July 29, 2011|accessdate=2011-07-29}}</ref> In the 100-meter butterfly, Phelps won his third consecutive title (also winning in 2007 and 2009) and second individual title of the meet with a time of 50.71.<ref>{{cite news|title=FINA World Championships, Swimming: Michael Phelps Threepeats 100 Fly|url=http://www.swimmingworldmagazine.com/lane9/news/27755.asp?q=FINA-World-Championships,-Swimming:-Michael-Phelps-Threepeats-100-Fly|work=Swimming World Magazine|date=July 30, 2011|accessdate=2011-07-30}}</ref> In his last event, the 4×100-meter medley relay, Phelps teamed with [[Nick Thoman]], [[Mark Gangloff]], and [[Nathan Adrian]] to win gold in a time of 3:32.06.  Phelps's butterfly leg of 50.57 was by far the fastest butterfly leg in the field.<ref>{{cite news|title=FINA World Championships, Swimming: United States Edges Australia for 400 Medley Relay Win|url=http://www.swimmingworldmagazine.com/lane9/news/27775.asp?q=FINA-World-Championships,-Swimming:-United-States-Edges-Australia-for-400-Medley-Relay-Win|work=Swimming World Magazine|date=July 31, 2011|accessdate=2011-07-31}}</ref>

