===Trials===

For the [[2012 Summer Olympics]] in [[London]], Phelps originally stated he would never do eight events again, and would instead try new events.  Phelps said, "I keep saying I want to go down and start sprinting, but Bob [Bowman, Phelps's coach] really isn't so keen on that ... I don't think that's going to happen ... Over the next four years, I'd like to try some different events, maybe not do some of the events I did here."<ref>Schaller, p.228.</ref><ref>Schaller, p. 229.</ref> However, at the [[2012 United States Olympic Trials (swimming)|2012 United States Olympic Trials]], the qualifying meet for the 2012 Summer Olympics, Phelps qualified in the same eight events that he swam in Beijing in 2008.  He later dropped the 200-meter freestyle from his program, as he stated he wanted to focus on the 4×100-meter freestyle relay.<ref name="sports.yahoo.com">{{cite web|author=PAUL NEWBERRY (AP National Writer) |url=http://sports.yahoo.com/news/phelps-locks-another-8-race-003623143--oly.html |title=Phelps locks up another 8-race program in London - Yahoo! Sports |publisher=Sports.yahoo.com |date=July 2, 2012 |accessdate=2012-08-01}}</ref> During the trials, Phelps finished first in the 200-meter freestyle, 100-meter butterfly, 200-meter butterfly, 200-meter individual medley, and second in the 400-meter individual medley.  In making his fourth Olympic team, Phelps holds the record for men for the most Olympic appearances in swimming representing the United States.<ref>{{cite web|last=Powers|first=John|title=Michael Phelps earns expected Olympic berth|url=http://www.bostonglobe.com/sports/2012/06/26/phelps-dives-right-earns-expected-berth/AcDM1AfTkPeBy5tcGUeHiL/story.html|work=The Boston Globe|accessdate=2012-06-26}}</ref>

===Olympics===
[[Image:London_2012_100m_butterfly_heats.jpg|thumb|275px|right|In his [[Swimming_at_the_2012_Summer_Olympics_–_Men's_100_metre_butterfly|100m butterfly heat]], Phelps (fourth from top) was 8th at the 50m split before winning his heat and qualifying for the semifinals]]
On July 28, 2012, Phelps placed eighth in the morning prelims. Phelps, the two-time defending Olympic champion, won his 400 IM heat in 4 minutes, 13.33 seconds with a time that was well off his world record of 4:03.84 set four years ago in Beijing, when Phelps won a record eight gold medals. He had just barely out touched second place finisher in his heat [[Laszlo Cseh]] by 0.07 seconds. In his first finals of the Summer Olympics, Phelps placed fourth behind fellow American [[Ryan Lochte]], [[Thiago Pereira]] of [[Brazil]], and [[Kosuke Hagino]] of Japan in the [[Swimming at the 2012 Summer Olympics – Men's 400 metre individual medley|400-meter individual medley]]. It was the first time Phelps failed to medal in an Olympic event since 2000.<ref>{{cite news| url= http://www.bbc.co.uk/sport/0/olympics/18910454|title= Ryan Lochte wins medley gold as Michael Phelps finishes fourth| date=July 29, 2012}}</ref>  The next night, in his second event of the Games, he got a silver as a member of the [[Swimming at the 2012 Summer Olympics – Men's 4 × 100 metre freestyle relay|4×100-meter free relay]].  Phelps swam the fastest leg of the US relay team and the second-fastest of anyone in the race.<ref>{{cite web | last = Layden | first = Tim | title = Phelps, U.S. fail to recreate Beijing magic, drop to silver in 400 relay |url=http://sportsillustrated.cnn.com/2012/olympics/2012/writers/tim_layden/07/29/france-us-400-relay-olympics/index.html#ixzz224CtJDdh|date=July 29, 2012 |work= Sports Illustrated |accessdate= 2012-07-29}}</ref>

On July 31, 2012, Phelps won a silver medal in the [[Swimming at the 2012 Summer Olympics – Men's 200 metre butterfly|200-meter butterfly]] behind [[South African]] [[Chad le Clos]] by only 5/100ths of a second, and a gold medal in the [[Swimming at the 2012 Summer Olympics – Men's 4 × 200 metre freestyle relay|4×200-meter freestyle relay]], thereby equaling and then surpassing [[Larisa Latynina]] to become the [[List of multiple Olympic medalists|all-time record holder]] for most Olympic medals won.<ref>{{cite web|title='Fab Five' brings home gymnastics gold|url=http://edition.cnn.com/2012/07/31/sport/olympics-day-wrap/index.html?hpt=hp_c1|publisher=CNN|accessdate=2012-08-01}}</ref><ref>{{cite web|title=Michael Phelps breaks record by reaching 19 Olympic medals in London|url=http://www.guardian.co.uk/sport/2012/aug/01/michael-phelps-19-olympic-medals-london?newsfeed=true|work=The Guardian|accessdate=2012-08-01}}</ref> Latynina was present at the race and asked to be the presenter of Phelps's medal, but was told that Olympic rules would not allow it.  She called Phelps deserving of the record.<ref>{{cite news|last = Longman | first = Jeré | url = http://www.nytimes.com/2012/08/01/sports/olympics/gymnast-larisa-latynina-is-elegant-reminder-of-olympics-history.html?pagewanted=1&_r=2 | title = Phelps Tops Another Olympian, but at 77, She Grins | date =July 31, 2012| page = A1 | accessdate =2012-08-01|work= The New York Times}}</ref>

On August 2, 2012, Phelps won his 16th Olympic Gold Medal when he edged out Ryan Lochte to win the [[Swimming at the 2012 Summer Olympics - Men's 200 metre individual medley|200-meter individual medley]] with a time of 1:54.27, and by that victory also became the first male swimmer to win the same event in three consecutive Olympics.<ref>{{ cite web | title = Michael Phelps wins 16th career gold |  url = http://espn.go.com/olympics/summer/2012/swimming/story/_/id/8227208/2012-summer-olympics-michael-phelps-outduels-ryan-lochte-take-gold-200-im-20th-medal |  publisher = ESPN | date = August 3, 2012 | accessdate = 2012-08-03 }}</ref> [[Rebecca Soni]] and Phelps (twice) are the only swimmers to successfully defend an individual title from the 2008 Games.<ref>{{cite news|last = Crouse | first = Karen | url = http://www.nytimes.com/2012/08/03/sports/olympics/soni-first-repeat-winner-in-swimming-franklin.html | title = Soni Sets World Record to Win 200 Breaststroke | date =August 2, 2012 | page = A1 | accessdate =2012-08-04| work = The New York Times}}</ref> This win also marked Phelps's fifth Olympic title in the individual medley, breaking the record of four shared by Hungarian [[Tamás Darnyi]] and Ukrainian [[Yana Klochkova]].

He repeated the achievement of winning the same event at three Olympics the following evening, winning the Olympic gold medal in the [[Swimming at the 2012 Summer Olympics – Men's 100 metre butterfly|100 m butterfly]], his last individual event.<ref>{{cite web | last = Zaccardi | first = Nick | title = Phelps surges toward exit as Franklin, Ledeckey rise to stardom | url = http://sportsillustrated.cnn.com/2012/olympics/2012/writers/nick_zaccardi/08/03/michael-phelps-olympics-swimming/index.html?eref=sihp&sct=hp_t11_a0  | work = London 2012  | publisher = cnnsi.com | date = August 3, 2012 | accessdate = 2012-08-03 }}</ref> After two very close victories in the 100 m butterfly at the 2004 and 2008 Olympics (by 0.04 and 0.01 sec, respectively), in this race Phelps beat Le Clos and [[Yevgeny Korotyshkin]], who tied for silver, by 0.23 sec.

Phelps's final event was the [[Swimming at the 2012 Summer Olympics – Men's 4 × 100 metre medley relay|4 × 100 metre medley relay]] in which he went on to win his 18th career gold medal and his 22nd overall. By winning 4 gold and 2 silver medals, Phelps concluded the 2012 Olympics as the most successful swimmer of the meet for the third Olympics in a row.<ref>{{cite news|title=2012 London Olympics: Michael Phelps Leads All Swimmers With Six Medals|url=http://www.swimmingworldmagazine.com/lane9/news/World/31591.asp?q=2012-London-Olympics:-Michael-Phelps-Leads-All-Swimmers-With-Six-Medals|accessdate=2012-08-04|newspaper=Swimming World Magazine|date=August 5, 2012}}</ref><ref name=number1>{{cite news|last=Almond|first=Elliott|title=Olympics: Michael Phelps shows once more why he's the gold standard in swimming|url=http://www.mercurynews.com/ci_21231419/olympics-michael-phelps-shows-once-more-why-hes?source=most_viewed|accessdate=2012-08-04|newspaper=Mercury News|date=August 3, 2012}}</ref>
After his last event, the international swimming federation [[FINA]] honored Phelps with an award commemorating his standing as the most decorated Olympian ever.<ref name=number1>{{cite news|title=Phelps ends career with gold in medley relay|url=http://sportsillustrated.cnn.com/2012/olympics/2012/08/04/phelps-medley-relay-gold.ap/index.html|accessdate=2012-08-04|newspaper=Sports Illustrated|date=August 4, 2012}}</ref>

==Testing for performance enhancing drugs==
During the 2008 Olympics Phelps was questioned by the press as to whether perhaps his feats were "too good to be true", a reference to unsupported rumors that Phelps might be taking [[performance enhancing drug]]s.<ref>Phelps, ''No Limits'', p. 185.</ref><ref>{{cite news|title=I'm clean , says history making Phelps|url=http://www.dnaindia.com/sport/report_i-m-clean-says-history-making-phelps_1183542|work=Daily News and Analysis |location=India|date=August 15, 2008|accessdate=2010-06-21}}</ref> In response, Phelps noted that he had signed up for Project Believe, a project by the [[United States Anti-Doping Agency]] in which U.S. Olympians can volunteer to be tested in excess of the [[World Anti-Doping Agency]] guidelines.<ref>{{cite news|title=Michael Phelps shrugs off question of drugs|url=http://www.timesonline.co.uk/tol/sport/olympics/article4537584.ece|work=The Sunday Times|author=Craig Lord|date=July 2, 2008|accessdate=2010-06-21 | location=London}}</ref> During the Games, Phelps passed all nine tests that were administered to him.<ref>{{cite news|title=Phelps deals with doping questions|url=http://www.theglobeandmail.com/archives/article704542.ece|work=Globe and Mail |location=Canada|author=Allan Maki|date=August 15, 2008|accessdate=2010-06-21}}</ref><ref>{{cite news|title=So Far, Drug Testing Has Revealed Only a Few Positives|url=http://www.nytimes.com/2008/08/16/sports/olympics/16doping.html|work=The New York Times|author=Gina Kolata|date=August 15, 2008|accessdate=2010-06-21}}</ref>

==Bob Bowman==
Phelps has trained under [[Bob Bowman (coach)|Bob Bowman]] since he was 11 years old.<ref>Schaller, p. 24.</ref> Bowman swam for [[Florida State University]] from 1983 to 1985.<ref>Schaller, p. 22.</ref> Phelps has said Bowman reminded him of a [[Drill instructor|drill sergeant]] because of his disciplined and regimented ways.<ref>Schaller, p. 25.</ref> However, Phelps has said, "Training with Bob is the smartest thing I've ever done ... I'm not going to swim for anyone else."<ref>{{cite news|title=Opposites attract|url=http://www.baltimoresun.com/sports/bal-te.sp.bowman16aug16,0,265609.story|work=The Baltimore Sun|author=Kevin Van Valkenburg|date=August 16, 2008|accessdate=2010-07-03}}</ref> After the 2004 Summer Olympics, Bowman was hired as the head coach for the [[University of Michigan]] after [[Jon Urbanchek]] retired.  Phelps joined Bowman at Michigan to train and attended classes, but did not pursue a degree.<ref>Schaller, p. 45.</ref><ref>Schaller, p. 66.</ref> Phelps served as a volunteer assistant coach at Michigan.<ref>{{cite web|url=http://www.mgoblue.com/sports/olympics/spec-rel/2012-olympics-roster.html |title=University of Michigan Official Athletic Site - Olympics |publisher=Mgoblue.Com |date=July 26, 2012 |accessdate=2012-08-01}}</ref> After the 2008 Summer Olympics, Bowman returned to Baltimore as CEO at the [[North Baltimore Aquatic Club]].  Phelps also returned to Baltimore with Bowman.<ref>Schaller, p. 27.</ref>

==Personal life==
[[File:Phelps Santa Clara 2009.jpg|thumb|right|Michael Phelps at Santa Clara, California, 2009.]]
Bob Bowman described Phelps as "a solitary man"<ref name="Phelps life">{{cite news|title =Profile: Michael Phelps|url =http://www.timesonline.co.uk/tol/sport/olympics/article4547306.ece|newspaper=The Sunday Times|date = August 17, 2008|archiveurl = http://www.webcitation.org/5sZXr3cIe|archivedate =September 7, 2010|accessdate =2010-09-07| location=London}}</ref> with a "rigid focus"<ref name="voyage" /> at the pool prior to a race, but afterwards "a man incredibly invested in the success of the people he cares about".<ref name="voyage" /> "He's unbelievably kind-hearted",<ref name="Phelps life" /> recounting Phelps's interaction with young children after practices.<ref name="voyage" />

===Controversies===
In November 2004, at the age of 19, Phelps was arrested for [[driving under the influence of alcohol]] in [[Salisbury, Maryland]].<ref>Schaller, p. 42.</ref> He pleaded guilty to [[driving while impaired]] the following month and was granted probation before judgment and ordered to serve 18&nbsp;months' [[probation]], fined $250, obligated to speak to high school students about drinking and driving and had to attend a [[Mothers Against Drunk Driving]] (MADD) meeting.<ref>{{cite news|url=http://www.cbsnews.com/stories/2004/11/08/national/main654380.shtml|title=Olympic Champ Sentenced For DUI|publisher=CBS News|date=December 29, 2004|accessdate=2008-02-14}}</ref> Questioned about the incident later that month by [[Matt Lauer]] on the [[Today (NBC program)|''Today Show'']], Phelps said it was an "isolated incident" and that he had "definitely let myself down and my family down ... I think I let a lot of people in the country down."<ref name="voyage" />

In February 2009, publication of a photograph of Phelps using a [[bong|water pipe]], a device used for smoking tobacco or [[marijuana]], resulted in the loss of [[Kellogg Company|Kellogg]] as a sponsor, as well as a three-month suspension from [[USA Swimming]].  Phelps admitted that the photo, taken at a student party at the [[University of South Carolina]], was authentic. Phelps publicly apologized and said his behavior was "inappropriate".<ref>{{cite news|title=Phelps Disciplined Over Marijuana Pipe Incident|url=http://www.nytimes.com/2009/02/06/sports/othersports/06phelps.html?ref=sports|work=The New York Times|author=Juliet Macur|date=February 5, 2009|accessdate=2009-02-05}}</ref>

===Ian Thorpe===
Phelps idolized Australian [[Ian Thorpe]] as a teenager, modelling his public image after him.<ref>Phelps, ''Beneath the Surface'', p. 95.</ref> Thorpe initially said it was highly unlikely for Phelps to win eight gold medals at the [[2008 Summer Olympics]] in Beijing.<ref>{{cite news|title=Thorpe's doubt of eight gold sweep spurs Phelps|url=http://www.theaustralian.com.au/news/thorpes-doubt-of-eight-gold-sweep-spurs-phelps/story-e6frg7mo-1111116988410|work=The Australian|author=Nicole Jeffery|date=July 23, 2008|accessdate=2010-06-21}}</ref> His remarks were used by Phelps, who stuck them on his locker as motivation during the Games.<ref>Phelps, ''Beneath the Surface'', p. 281.</ref> Thorpe was in the stands for the [[Swimming at the 2008 Summer Olympics – Men's 4 × 100 metre medley relay|4×100-meter medley relay]], where Phelps was swimming for his eighth Olympic title. When Phelps and his teammates captured the gold, Thorpe gave a congratulatory kiss to Phelps's mother, then gave a handshake and a hug to congratulate Phelps. Thorpe afterwards said "I'm really proud of him not just because he won eight golds. Rather, it's how much he has grown up and matured into a great human being. Never in my life have I been so happy to have been proved wrong. I enjoyed every moment of it."<ref name="Phelps, No Limits, p. 218"/> He added, "I just couldn't envision it happening.  And I didn't think he would get all eight, not because Michael couldn't win, but because of the competition.  It's been a very tough week to get through.  I couldn't do it.  You couldn't imagine much closer races.  The 4×100 free goes down as one of the all-time great races."<ref>Schaller, p. 196.</ref><ref>{{cite news|title=Ian Thorpe happy to have been proved wrong by Michael Phelps |url=http://www.telegraph.co.uk/sport/othersports/olympics/2591815/Ian-Thorpe-happy-to-have-been-proved-wrong-by-Michael-Phelps-Olympics.html|work=The Daily Telegraph|author=Kaz Mochlinski|date=August 20, 2008|accessdate=2010-06-21 | location=London}}</ref>

===Philanthropy===
{{Double image|left|Michael Phelps with im program participants - 20080909.jpg|130|Logo of the Michael Phelps Foundation's im program.jpg|130|Michael Phelps with im program participants. (''left''), Michael Phelps Foundation's im logo (''right'')}}

After the 2008 Olympics, Phelps used his $1-million Speedo bonus to set up the Michael Phelps Foundation.<ref>Phelps, ''No Limits'', p. 227.</ref><ref>{{cite news|title=Phelps to use $1 million bonus to start charity|url=http://today.msnbc.msn.com/id/26506320/|publisher=TODAY People|author=Bob Considine|date=September 2, 2008|accessdate=2010-06-21}}</ref><ref>{{cite web|last=Johnson|first=Drew|title=Michael Phelps Launches Foundation, Donates Speedo $1 Million Bonus to Charity Olympic Gold Medalist Embarks on Eight-City Tour|url=http://www.warnaco.com/content/speedousa.com/20080902/20080902_mp.html|accessdate=2012-05-30}}</ref> His foundation focuses on growing the sport of swimming and promoting healthier lifestyles.<ref>Phelps, ''No Limits'', p. 226.</ref>

In 2010, the Michael Phelps Foundation, the Michael Phelps Swim School and [[KidsHealth]].Org developed and nationally piloted the "im" program for [[Boys & Girls Clubs of America|Boys & Girls Club]] members.  The im program teaches children the importance of being active and healthy, with a focus on the sport of swimming. It also promotes the value of planning and goal-setting.<ref name=valkenburg>{{cite news|last=Van Valkenburg|first=Kevin|title=Phelps expands swimming education initiative|url=http://www.baltimoresun.com/sports/bs-sp-phelps-foundation-0624-20110623,0,136720.story|newspaper=[[Baltimore Sun]]|accessdate=2012-08-08|date=June 24, 2011}}</ref> ''im'' is offered through the Boys & Girls Clubs of America<ref name=valkenburg /> and through [[Special Olympics]] International.<ref>{{cite news|last=Murphy|first=Mandy|title=Michael Phelps Becomes Special Olympics' Newest Global Ambassador |url=http://www.specialolympics.org/Press/2011/Michael_Phelps_Becomes_Special_Olympics_Global_Ambassador.aspx# |accessdate=2012-05-30|date=August 1, 2010}}</ref> The Foundation has since developed two other programs, [[Level Field Fund-Swimming]] and Caps-for-a-Cause.<ref>{{cite web|last=Michael Phelps Foundation|title=Programs|url=http://michaelphelpsfoundation.org/the_foundation.php|publisher=Michael Phelps Foundation|accessdate=2012-05-30}}</ref><ref>{{cite news|title=Level Field Fund Establishes Level Field Fund – Swimming|url=http://www.levelfieldfund.org/level-field-fund-establishes-level-field-fund-%E2%80%93-swimming|accessdate=2012-05-30|date=August 16, 2010}}</ref>

The Foundation's largest event is its annual fundraiser, the Michael Phelps Foundation Golf Classic.<ref>{{cite news|last=Van Valkenburg|first=Kevin|title=Tee times, not London, keeping Phelps busy|url=http://articles.baltimoresun.com/2010-09-14/sports/bs-sp-phelps-0914-20100913_1_bob-bowman-michael-phelps-promising-swimmers|accessdate=2012-05-30|newspaper=Baltimore Sun|date=September 14, 2010}}</ref><ref>{{cite web|last=Phelps|first=Michael|title=Michael Phelps Foundation Golf Classic|url=http://paceclub.speedousa.com/athletes/blog_posts/michael-phelps-foundation-golf-classic|publisher=Speedo Pace Club|accessdate=2012-05-30}}</ref> Phelps stated he hopes to work with Foundation more after he retires from competition following the [[2012 Summer Olympics]] in London.<ref>{{cite news|last=Schultz|first=Jordan|title=Michael Phelps On London 2012 Olympics, His New Post-Swimming Diet And Retirement Plans|url=http://www.huffingtonpost.com/2012/05/11/michael-phelps-on-london-olympics_n_1499884.html|accessdate=2012-05-30|work=Huffington Post|date=May 11, 2012}}</ref>
{{clear}}

==Honors and awards==
[[File:Phelps and Busch 2009.jpg|thumb|right|Phelps and Maryland House Speaker [[Michael E. Busch|Mike Busch]] in April 2009. Both houses of the [[Maryland General Assembly]] honored Phelps that day.]]
Phelps was a USA Olympic team member in 2000, 2004, 2008 and 2012, and holds the records for most Olympic gold medals (18), most such medals in individual events (11), and most such medals at a single games (8, in Beijing 2008).<ref name="phelpsbio">{{Cite news|publisher=USA Swimming|title=USA Swimming bio: Michael Phelps| url=http://www.usaswimming.org/DesktopModules/BioViewManaged.aspx?personid=4beec290-d7ae-483d-a512-36b18a4e022a&TabId=1453&Mid=10312|accessdate= 2010-08-25}}</ref> A street in his hometown of Baltimore was renamed The Michael Phelps Way in 2004.<ref>{{cite news|title = Athlete Bio: Michael Phelps |url =http://www.nytimes.com/2008/07/26/sports/olympics/biophelps.html|newspaper=The New York Times|date = July 26, 2008|archiveurl = http://www.webcitation.org/5sWfnpqdn|archivedate =September 5, 2010|accessdate =2010-09-05}}</ref> On April 9, 2009, Phelps was invited to appear before the [[Maryland House of Delegates]] and the [[Maryland Senate]], to be honored for his Olympic accomplishments.<ref>{{cite web|url=http://weblogs.baltimoresun.com/news/local/politics/2009/04/michael_phelps_general_assembl.html|title=Phelps wins over General Assembly, hopes Preakness stays in Maryland|work=The Baltimore Sun|accessdate=2009-04-11}}</ref><br />
