* ''[[Swimming World Magazine]]'' [[Swimming World Swimmers of the Year#American Swimmer of the Year|American Swimmer of the Year Award]]: 2001, 2002, 2003, 2004, 2006, 2007, 2008, 2009, 2012<ref name="Swimming World Awards" /><ref>{{cite news|title = Swimming World Names 2009 American Swimmers of the Year|url =http://www.swimmingworldmagazine.com/lane9/news/22830.asp|work=Swimming World Magazine|date = November 29, 2009|archiveurl =http://www.webcitation.org/5sWbpfsY0|archivedate =September 5, 2010|accessdate =2010-09-05}}</ref>
